import { Link } from "react-router-dom";
export default function header(){
    return (

        <header>
        <Link to="/" className="logo">Dail</Link>
        <nav>
            <Link to="/register">Register</Link>
            <Link to="/login">Login</Link>
        </nav>
    </header>


    );
}
